INSERT INTO `park` VALUES (1,'남산도시자연공원','남산공원은 도심에 위치하여 서울시민에게 맑은 공기를 제공하는 자연휴식처이며 산책 꽃구경 공연관람 서울타워 남산케이블카 이용 등 다양한 활동이 가능한 대표적 휴식 여가 생활의 중심지입니다.','명동역(남산케이블카 와룡묘 서울애니메이션센터 방면) 도보 명동역 3번출구 → 퍼시픽호텔 방향 → 남산케이블카 매표소 (도보 10분) 명동역 4번출구 → 직진→ 회현사거리(남산 3호터널 방향 좌회전) → 남산오르미 → 남산케이블카 매표소→ 남산 북측순환로 → 잠두봉포토아일랜드→ 팔각정 →서울타워(47분 2.3km) 셔틀버스 명동역 3번 출구 → 동보성주차장 앞 남산케이블카 셔틀버스 이용(무료) 배차시간 1시간 (첫차 11:00 막차 21:30) ☎ 02)753-2403 충무로역(남산골 한옥마을 북측순환로) 도보 충무로역 34번출구 → 남산골 한옥마을 정문(도보 5분) → 서울남산국악당 → 남산골 한옥마을 후문 ？ 남산 북측순환로 (18분 1.2km) 동대입구역(장충단비 장충유아숲체험장 석호정 국립극장) 도보 동대입구역 6번출구 → 국립극장 → 남산 남측순환로→장충 유아숲체험장 → 서울타워 (50분 3.35km) 서울역(남산도서관 안중근의사기념관 방면) 도보 1호선 서울역 4번 출구 → 숭례문 → 힐튼호텔 방향 → 백범광장 → 잠두봉포토아일랜드 → 서울타워 (49분 3.2km) 회현역 34번 출구 → 도동삼거리 → 백범광장 → 서울시교육연구정보원 ？ 잠두봉포토아일랜드 → 서울타워 (32분 1.9km) 버스 서울역 9-1번 출구 → 5번 승강장 402번 승차 → 남산도서관 하차 → 남측순환로 ？ 서울타워(30분 3.29km) 이태원역한강진역버티고개역(한남공원이용지원센터한남유아숲체험장) 도보 한강진역 1번출구 → 100m직진 우측 나무계단(소월로방향) → 하얏트호텔 방향 → 육교건너편 → 공원이용지원센터 (카페 간판있는 건물1층) ？ 한남유아숲체험장 → 남측소나무탐방로(44분2.9km) 버스 서울역 9-1번출구 → 5번 승강장 (402번 승차) → 하얏트호텔 정류장 하차 →  육교 건너편 공원이용지원센터(카페 간판있는 건물1층) (24분 4.8km) 이태원1번출구 → 도보10분 → 용산03번 승차(녹사평역 용산구청 정류장) → 하얏트호텔 종점 하차 ？ 공원이용지원센터(30분 2.8km) 녹사평역 3번출구(녹사평역 용산구청 정류장) → 용산03번 승차 → 하얏트호텔 종점 하차 → 공원이용지원센터(20분 2.2km) 남산정상(서울타워팔각광장) 방면 명동역 3번출구 → 140m 이동 → 명동입구 정류장 05번 탑승 (22분 5.85km) 충무로역 24번출구 (퇴계로3가/한옥마을/한국의집 정류장 대한극장앞 정류장) 02번 승차 (12분 2.54km) 05번 승차 (20분 4.96km) 동대입구역 6번출구  → 후진 240m 이동 → 동대입구역 장충동 정류장 02 03 05번 승차 (16분 3.16km) 서울역 9번 출구 → 남대문경찰서 정류장 03번 승차 (33분 7km) 회현역 5번출구 →남대문시장악세사리전문상가 정류장 05번 승차 (30분 7km) 한강진역 2번 출구 → 03번 승차(21분 4.03km) 이태원역 4번 출구 → 03번 승차(24분 4.92km) 버티고개역 3번 출구 → 03번 승차(16분 2.87km)','중구','서울특별시 중구 삼일대로 231(예장동)','02-3783-5900'),(2,'길동생태공원','길동생태공원은 생물의 서식처를 제공하고 종다양성을 증진시키며 자연생태계의 생물들을 관찰 체험할 수 있도록 하여 시민들에게 건강한 생태공간을 제공하고 환경의 중요성을 일깨워주기 위한 공간입니다.','','강동구','서울특별시 강동구 천호대로 1291(길동생태공원) ','02-489-2770'),(3,'서울대공원','서울대공원은 세계 각국의 야생동물들이 살아 숨 쉬는 서울동물원과 다양한 재미와 즐거움을 주는 서울랜드 자연과 사람의 특별한 이야기가 있는 테마가든 그리고 자연의 소중함을 배우는 서울대공원 캠핑장 신나는 어린이 체험놀이터 기린나라 근?현대 미술계의 흐름을 한눈에 볼 수 있는 국립현대미술관으로 구성되어 있는 대한민국 대표 종합 테마파크입니다.','지하철 4호선 대공원역 하차(2번 출구) 도보 15분 정도 문의처 02)500-7335 주차장 주차가능 수 : 6750 대 ','과천시','경기도 과천시 대공원광장로 102','02-500-7032'),(4,'서울숲','당초 골프장 승마장 등이 있던 뚝섬일대를 주거업무 지역으로 개발할 경우 약 4조원에 달하는 개발이익이 예상되었으나 서울시민들의 웰빙공간을 영국 하이드파크(Hyde Park) 뉴욕센트럴파크 (central Park)에 버금가도록 마련하고자 공원조성사업비 235.259백만원을 투자하여- 자연과 함께 숨쉬는 생명의숲- 시민과 함께 만드는 참여의숲- 누구나 함께 즐기는 기쁨의 숲인 서울숲을 조성함.','','성동구','서울특별시 성동구 뚝섬로 273 (성수동1가) ','02-460-2905 '),(5,'월드컵공원','월드컵공원은 서울의 서쪽에 위치하여 1978년부터 1993년까지 15년간 서울시민이 버린 쓰레기로 만들어진 2개의 거대한 산과 넓은 면적의 평매립지를 2002 월드컵 개최와 새 천년을 기념하기 위하여 난지도 쓰레기매립장을 안정화 공원화하면서 270만㎡의 면적의 대규모 환경?생태공원으로 대표 공원인 평화의공원을 비롯하여 하늘공원 노을공원 난지천공원난지한강공원의 5개 테마공원으로 조성되었습니다.  ','지하철 6호선 월드컵경기장역 하차 → 1번 출구로 나온 후 직진 → 큰길(도로)이 나오면 정면에 마포농수산물시장이 보이고 → 횡단보도를 건너시면→ 평화의공원 주차장→ 주차장을 지나면 평화의공원입니다. 공원녹지사업소는 마포농수산물시장을 따라 직진→ 시장건물이 끝나는 지점에 관리사업소(2층)가 있습니다 1번 출구로 나온 후 직진 → 큰길(도로)이 나오면 우측으로 풍력발전기가 있는 하늘공원이 보이며 →횡단보도를 건너(여기서부터 평화의공원) →평화의공원과 하늘공원 사이의 육교를 건너신 후 →하늘계단 또는 사면도로를 이용  버스(G 지선 B 간선 R 광역 Y 순환) 월드컵경기장남측 월드컵경기장(마포 농수산물시장) 자동차검사소에서 하차 G 7011 7013 7714 7715 마을버스 마포08 B 171 271 571 승용차 내부순환로 (성북 노원 상계 도봉) 성산을 빠져나온 후 → 경기장 방향으로 우회전 → 직진 → 경기장 남문 주차장에서 좌회전을 하면 평화의 공원 주차장 또는 사거리에서 좌회전하여 난지천공원 주차장 주차 강변북로(강남 송파방면) 월드컵경기장 표지판이 보이면 빠져나옵니다 → 오른쪽이 평화의 공원 왼쪽이 하늘공원입니다. → 사거리에서 좌회전을 하시면 평화의공원 주차장 직진하여 월드컵터널위로 유턴→ 난지천공원 주차장에 주차 자유로(일산방면) 가양대교에서 빠져나옵니다 → 첫번째 신호등에서 우회전→ 경기장 방향으로 직진 → 난지천공원 또는 평화의 공원 주차장에 주차 서부간선도로(구로 영등포 양천) 성산대교를 건너 → 1차선으로 오시다가 → 내부순환로 진입전 경기장 방향으로 진입→ 경기장 3거리에서 좌회전을 하신 후 → 경기장 남문 주차장에서 좌회전을 하여 평화의 공원 주차장에 주차 또는 사거리에서 좌회전하시면 난지천공원 주차장에 주차 가양대교를 건너 수색방면으로 직진(오른쪽이 노을공원)→ 첫번째 신호등에서 우회전→ 경기장 방향으로 직진 → 난지천공원 또는 평화의 공원 주차장에 주차 주차장 월드컵공원 주차장은 월드컵축구경기 대회기간 동안에는 무료로 운영하였고 2004년11월1일부터 주차장 이용시간에 따라 3급지 요금을 적용하고 있습니다. 주차장 운영시간은 09:00?22:00까지이며 그 이후 시간은 무료로 개방하고 있습니다.(주말/ 공휴일 동일요금 적용) 장애인 및 국가유공자 80% 할인 차량에 장애인 및 국가유공자 표지를 부착하고 복지카드국가유공자증서를 소지하고 본인이 탑승한 차량에 한함 경차 50% 할인 승용차요일제 참여 차량 30% 할인 기타 주차요금 할인율은 법률 및 조례에 따릅니다. 2이상의 주차요금 감면사유에 해당하는 때에는 그중 감면율이 높은 하나만 적용 주차장에 관한 자세한 내용은