건설되기 이전 이곳에는 적벽돌로 장식되고 내부구조는 백두산에서 벌목되어 압록강을 따라 황해로 운반된 육송으로 지어진 목조건물이 있었다. 이 건물 철거시 회수한 목재를 가공하여 여기 안내판을 제막하는데 사용함으로써 옛 내음을 보존하고자 하였다.','지하철 2호선 4호선 5호선 동대문운동장역 13번 출구 을지로 방향 300M 정도 버스(G 지선 B 간선 R 광역 Y 순환) 방산시장 하차 G 1011 1013 2014 B 101 103 104 106 R 9403 9410 을지로5가 하차 B 152 500 승용차 동대문운동장 → 국립의료원 → 훈련원 공원 주차장 주변 주차장(유료 기본 30분 1500원)을 이용바랍니다.','중구','서울특별시 중구 을지로 227','02-3396-5894'),(16,'영등포근린공원','1933년 맥주회사로 출발 60여년동안 약 백억병의 맥주를 생산해 온 우리나라 최대 맥주회사 중 하나인 OB맥주(주)의 최초 공장터로 97년 경기도 이천으로 공장이 이전되면서 서울시에서 공원녹지확충 5개년 계획에 따라 부지를 매입하여 97년부터 98년 7월까지 공원으로 조성하였다. 맥주제조에 이용되던 담금솥을 이 공원의 랜드마크(Land Mark) 로 남겨두었다. ','지하철 1호선 영등포역 1번출구 역사후문 (롯데백화점 뒤편)으로 나와서 소화물 센터 쪽으로(도보 4분 소요) 5호선 신길역 3번 출구(도보 3분 소요) 버스(G 지선 B 간선 R 광역 Y 순환) 영등포역 하차 G5616 5620 5627 5713 B570 영등포공원 하차 G16-4(영등포) 16-6(영등포) 5012 5614 5615 5616 5618 5625 5627 5714 6512 6513 6514 6628 6629 6630 6631 6637 6638 6639 7612 B160 162 260 261 262 360 361 503 570 600 605 R9707 9408 9412 5601 [경기 도시형버스] 11-1 [경기 직행좌석버스] 300 301 5601 [경기 좌석버스] 82 83 87 87-1 301 320 승용차 영등포 로타리에서 시흥IC 타고 신길 굴다리 지나면 바로 우측 문의 전화 2670-3774 주차장 10분당 300원 이하 월정기권(주간 10만원 야간 4만원)','영등포구','서울특별시 영등포구 신길로 275','02-2670-3716'),(17,'보라매근린공원','보라매공원은 서울특별시 동작구 신대방동 395번지 대방로 219 일대인 옛날 공군사관학교 자리를 1985년 12월 20일에 보수하여 1986년 5월 5일 개원하면서 공군사관학교 때의 상징인 \'보라매\'를 그대로 이름에 사용하여 오늘에 이르고 있다. 주요 시설로는 잔디광장 에어파크 연못(음악분수) 다목적운동장 인조잔디축구장 배드민턴장 암벽등반대 등이 있고 맨발공원 등 휴양 시설과 각종 편익 시설도 구비되어 있다. 특히 비행기 8대가 전시되어 있는 에어파크는 옛 공군사관학교의 정기를 느낄 수 있으며 공원 내에는 한국 자유총연맹 서울시 지회 한국청소년연맹 서울시립보라매청소년수련관 동작구민회관 서울시립지적장애인복지관 남부장애인복지관 동작경찰서보라매파견소와 2010년 5월 개관한 시민안전체험관 등 11개 기관이 입주하고 있다. ','지하철 7호선 보라매역 2번 출구 보라매공원 방향으로430미터 도보로 10분 2호선 신대방역 4번 출구 문창초등학교 방향으로 285미터 도보로 8분  버스(G 지선 B 간선 R 광역 Y 순환) 보라매공원 동문입구  * 보라매병원 하차 G 5516 6513 6514 6515 6516 B 152 153 461 504 * 롯데관악점 하차 G 5516 5522B호암 5524 5525 5535 6511 6516 B 153 보라매공원 정문입구 : 보라매공원 하차 G 5531 5536 5623 5633 B 150 505 보라매공원 정문초소입구  Y 동작05(대방역~신대방역 05:45~23:50배차간격 10분) Y 동작05-1(대방역~신대방역. 05:50~23:50. 배차간격 15분)  승용차 보라매공원 정문주차장 . 대방로 대방역 지하차도를 지나 대림