 승용차 천호사거리에서 암사역 방향으로 600미터  주차장 주차가능 수 : 10 대 주차장 면적 : 246㎡ ','강동구','서울특별시 강동구 올림픽로 702(천호공원)','02-489-2776'),(20,'용산가족공원','넓은 잔디밭과 연못 등 서구풍의 공원 모습을 느낄 수 있는 곳으로 임진왜란(1592~1598년)때 왜군이 병참기지(兵站基地)로 사용하였고 임오군란(1882년)때는 청나라 군사가 점유하였으며 갑신정변(1884년)과 러일전쟁(1904년) 그리고 1906년부터 1945년 해방 전 까지 일본인들이 군 시설 및 거주지 등으로 사용하였다. 6?25 때 UN군 및 주한미군사령부가 설치되었던 것을 1992년 서울시에서 인수하여 공원으로 조성한 것이다. 또 남산과 한강 사이에 위치해 서울시의 남북 녹지축의 연결고리로 서울시 녹지체계의 구심점이 되며 중앙공원의 성격을 띄고 있다. 전체 공원부지중 골프장이 들어 서있던 곳에 언덕 잔디 광장 연못을 위주로 개방적이고 단란한 분위기의 공원이 조성되어 서울시민들의 자유롭고 평화로운 휴식처로 각광을 받고 있다. ','지하철 4호선 2번출구 이용 1호선 이촌역 서빙고역 이용 버스(G 지선 B 간선 R 광역 Y 순환) 용산가족공원 하차 G 0211 R 9502 승용차 서빙고로를 통하여 용산가족공원으로 오시면 입구에 승용차 50대를 주차할 수 있는 주차장이 있습니다. 승용차 전용 주차장으로 버스나 화물차 등은 주차하실 수 없습니다. 용산가족공원은 가족나들이 향우회 유치원 초.중.고등학생들의 소풍 백일장 공연 등의 행사로 많은 시민들이 이용하여 주차장이 만차되어 혼잡하오니 대중교통을 권장하여 드립니다. 주차장 주차가능 수 : 50대 5분당 150원 장애인차량 국가유공자 : 최초 1시간 무료 및 80%할인','용산구','서울특별시 용산구 서빙고로 185','02-792-5660'),(21,'독립근린공원','1992년 8월 15일 개원한 독립공원은 조국의 독립을 위해 항거하다 옥고를 치렀던 애국지사의 자주독립 정신을 후손에게 기억시키기 위해서 만들어졌습니다. 그동안 독립공원은 공원입구에 주택ㆍ상가지역이 무질서하게 자리 잡고 주요 시설이 산재되어 있어 시민들의 공원 이용에 불편이 많았으나 2007년 4월 16일부터 추진한 독립공원 재조성 사업을 통해 2009년 10월 28일 재개장하여 독립문 역사관 독립관 순국선열추념탑 등을 유기적으로 연결함과 동시에 시민이용에 불편을 초래했던 노후한 공원시설을 정비하여 공원을 방문하는 학생 관광객 시민고객들의 편의를 최대화 하였습니다. 특히 독립문은 그동안 시민들의 접근을 제한하였으나 서대문독립공원 재조성 사업으로 인하여 112년 만에 시민들에게 개방하게 되었습니다. 서대문독립공원은 역사의 현장임과 동시에 주민들의 포근한 쉼터이기도 하고 자연 속 휴식처 어울 쉼터에서는 다양한 체육시설을 이용하고 여가를 즐길 수 있으며 또한 부모와 자녀가 함께 공부를 할 수 있는 환경이 조성되어 있어 아이들이 배울 역사의 산 교육장소입니다.','지하철 3호선 독립문역에서 내려 4번 5번출구를 이용  버스(G 지선 B 간선 R 광역 Y 순환) 독립문역한성과학고 하차 G 7(서대문) 7019 7021 7023 7712(신촌방향) B 471 701 703 704 720 R 9701 9703 9705 9709 9712  승용차 : 독립공원 교차로에서 서대문구의회 및 한성과학고등학교 방향으로 진입하여              좌측 방향으로 주차장진입로 위치  주차장 주차장 개방시간 : 24시간 상시개방 주차요금 : 09시 ~ 22시 요금부과(기타시간대 무료개방)            - 대형 10분당 630원(10시~14시 10분당 900원)            - 소형 10분당 300원            - 할인적용 : 서울시 주차장 설치 및 관리조례 제6조 제1항 별표1에 의거 적용주차가능 수 : 36대(대형 33대 소형3대) 주차장 면적 : 4637㎡         * 주차장이 협소하여 혼잡하오니 대중교통을 이용하시기 바랍니다. ','서대문구','서울특별시 서대문구 통일로251(독립공원)','02-364-4686'),(22,'낙산근린공원','낙산은 서울의 형국을 구성하던 내사산(남산 인왕산 북악산 낙산)의 하나로 풍수지리상 주산인 북악산의 좌청룡에 해당하는 산이다. 이렇게 소중한 자연환경과 문화유산을 지니고 있는 낙산은 일제의 강점기를 거쳐 현재에 이르기까지 상당한 부분 파괴 ? 소실되었고 특히 60년대 이후의 근대화 과정에서 무분별한 도시계획으로 인해 아파트와 주택이 낙산을 잠식한 채 오랜 시간 방치되어 역사적 유물로서의 제 기능을 상실하게 되었다.','지하철 4호선 혜화역 2번 출구 마로니에 공원기업은행 방향 (도보10분)  버스(G 지선 B 간선 R 광역 Y 순환) 혜화역 (마로니에공원) 정류장 하차. 마로니에 공원 기업은행 방향 (도보10분) G 1011 1012 1018 1019 2112 B 101 102 103 104 106 107 140 143 150 160 161 100 151 301 R 9101 9410 14호선 동대문역 5번 출구→마을버스 낙산종점 하차 G 종로03 6호선 창신역 3번 출구→마을버스 낙산종점 하차 G 종로03  주차장 주차가능 수 : 29대 ','종로구','서울특별시 종로구 낙산길 41 (우) 03085','02-743-7985~6'),(23,'양재시민의숲','시민의숲은 우리나라 최초로 숲 개념을 도입한 공원으로 도심에서 보기 힘든 울창한 수림대를 품고 있어 시민들에게 훌륭한 녹색 휴식 공간을 제공하고 있다. 공원은 86 아시안 게임과 88 올림픽을 앞두고 당시 서울의 관문이었던 양재 톨게이트 주변 환경을 개선하기 위한 공원조성계획의 일환으로 1983년 착공에 들어가 1986년 11월 개장했다. 매헌로를 기준으로 시민들이 주로 이용하는 북측 구역과 다양한 위령탑 등이 들어서 있는 남측 구역으로 나뉘는데 북측 구역은 입구에 매헌윤봉길의사기념관이 있으며 울창한 숲이 있어 공원을 산책하는 시민들에게 사랑받는 공간이다. 연못과 분수 등의 수경시설과 어린이놀이터 다양한 운동시설이 있고 야외 예식장과 바비큐장이 있는 것도 커다란 특징이다. 남측 구역에는 유격 백마부대 충혼탑과 1987년 미얀마 안다만해협 상공에서 북한의 테러로 폭파된 대한항공 858편의 위령탑 1995년 삼풍백화점 붕괴로 사망한 희생자와 유족들을 위로하기 위해 세운 위령탑이 있다.','지하철 2호선 강남역 6번출구 뉴욕제과방향으로 나와서 버스 이용 3호선 양재역 7번출구 성남방향으로 나와서 버스 이용 신분당선 시민의숲 공원 역(매헌역)1번5번 출구  버스(G 지선 B 간선 R 광역 Y 순환) G 4421 4422 4423 4424 5411 B 140 400 470 471 R 1550 9100 9200 9300 9400 9404 9405 9406 9408 9410 9411 9412 9503 9700 [경기 도시형버스] 11-3 11-6 901 1550 [경기 직행좌석버스] 1005-1 1005-5 1550-1 1560 3000 3000-1 3001 3003 3007 3030 5100 5100-1 9700 [경기 좌석버스] 1500-1 1500-3 5002 5500-1 5500-2 6800  승용차 승용차 이용시 매헌기념관 앞 또는 강남대로변의 시민의 숲 주차장을 유료로 이용할 수 있습니다.  매헌윤봉길기념관 주차장 주차가능 수 : 54 대 주차장 면적 : 1500㎡ 주차요금 : 매 10분마다 300원 ~ 450원 주차장 요금     1회 주차  월 정기권   매 5분당 주간 야간  150원 100000원 40000원   1일 주차요금은 10000원을 초과하지 않으며야간 주차장 무료 개방(21:00-09:00) 시민의숲 동축주차장과 관련없습니다.  ','서초구','서울특별시 서초구 매헌로 99 (양재동)','02-575-3895'),(24,'관악산도시자연공원','관악산은 서울시 관악구 신림동과 금천구 시흥동 독산동과 경기도 안양시 과천시에 걸쳐있다. 관악산(높이 629m)은 1973년 관악구가 영등포구에서 분리되면서 명산으로서의 산 이름이 구의 명칭이 되어 관악구의 상징이자 자랑이 되고 있으며 관악구 문화유산의 대부분이 관악산에서 비롯되었다. 1968년에 건설부 고시 제34호로 도시자연공원으로 지정되었으며 오늘날에는 수많은 서울 시민들이 즐겨 찾는 휴식처로 서울의 명소가 되었다.  관악산 정상에는 지상 레이더 관측소와 조선 태조 이성계가 서울을 도읍지로 정할 때 연주사와 원각사 두 절을 지어 화환(火患)에 대처했다고 하는 정상의 원각사와 연주암을 비롯하여 크고 작은 사찰과 암자가 있는데 아슬아슬한 벼랑 위에 자리 잡고 있는 연주대는 관악산의 모든 등산로가 집결하는 곳이다. ','지하철 2호선서울대입구역 3번 출구 연계버스 5511 5528 501 651 6511(만남의광장 출발) 24호선사당역 45번 출구(관음사 출발)  버스(G 지선 B 간선 R 광역 Y 순환) 연계버스 G 142 95 300 142  접근방법 제1등산로 : 사당역 4번출구에서 관음사까지 도보 제2~6등산로 : 서울대입구역 2번출구에서 서울대방향 버스 승차 후 서울대정문 버스정류장 하차 제7~8등산로 : 삼성산성지 정류장 하차(65145517버스)  주차장 주차가능 수 : 153 대 10분당 300원 1시간 1800원(09:00?18:00는 유료 18:00 이후 이용시간 관계없이 1000원 연중무휴) ','관악구','서울특별시 관악구 관악로 1(관악산공원)','02-2627-1653'),(25,'효창근린공원','효창원(孝昌園)은 본래 조선조 22대 정조대왕(正祖大王)의 장남인 문효세자(文孝世子)와 그의 생모(生母)인 의빈(儀嬪) 성(成)씨와 순조(純祖)의 후궁 숙의(淑儀) 박(朴)씨 및 영온 옹주(永溫翁主)의 묘가 안장되었으나 일제의 간교하에 사적(史蹟)의 격하를 위해 1924년 경성부가 효창원 일부를 공원으로 개발하고 1940년 총독부고시 제208호에 의해 공원으로 지정되었다. 일제 말기 세자 묘를 경기도 고양시 소재 서삼릉(西三陵)에 강재로 옮김에 따라 효창원은 효창공원이 되었다.  광복과 더불어 환국한 임시정부 주석인 백범(白凡) 김구(金九)선생이 조국 광복을 위해 기꺼이 목숨을 바친 이봉창(李奉昌) 윤봉길(尹奉吉) 백정기(白貞基) 의사(義士)의 유해와 안중근(安重根)의사의 가묘(假墓)를 1946년 7월 효창공원에서 국민장(國民葬)으로 지금의 삼의사 묘역에 안장하였고 1948년 9월에는 중국 땅에서 순국한 임시정부 의장과 주석을 지낸 이동녕(李東寧) 국무원비서장(國務院秘書長)을 지낸 차이석(車利錫)선생의 유해와 군무부장(軍務部長)을 역임하고 귀국 후 서거한 조성환(曺成煥)선생을 지금의 임정요인 묘역에 안장시켰다. 1949년 6월에는 김구선생이 흉탄에 쓰러지자 그해 7월 5일 국민장으로 공원 서북쪽 언덕에 안장하였다. 이후 이 일대가 독립운동에 앞장선 선열들의 묘역으로 자리 잡게 되었다.  1978년 3월 10일 효창공원 순국선열추모위원회가 발족된 후 임시정부 수립일인 4월 13일을 7위선열 합동추모제로 매년 봉행되고 있으며 1988년 11월 정부주도하에 효창공원 정비공사가 추진되어 의열사(義烈祠)와 창열문(彰烈門)이 건립되었고 1989년 6월에는 사적제330호로 지정되었다. 현재 효창공원에는 선열묘역과 공원관리사무소 어린이놀이터 배드민턴장 체육시설등의 편의시설과 반공투사위령탑 원효대사상 백범기념관 대한노인회등이 자리 잡고 있다. ','지하철 6호선 효창공원역 하차 1 2번 출구(도보 10분 소요) 4호선 숙대입구역 하차 8 9번 출구(도보 20분 소요)  버스(G 지선 B 간선 R 광역 Y 순환) 효창공원 후문/ 숙대 후문 하차 G 0015 0016 마포17 효창운동장 입구 하차 G 0015 0016 마포17  승용차 공덕동로터리에서 삼각지 방향 효창공원역 사거리에서 좌회전→숙대방향으로 300m 직진 좌측에 위치 원효로 용산구청앞 사거리에서 좌회전(우회전) 공덕동로터리 방향→효창공원역 사거리에서 우회전 숙대방향으로 300m 직진 좌측에 위치  주차장 공원주차장이 없으니 효창운동장 주차장을 이용바랍니다. 이용시간 : 24시간개방 이용요금 : 10분당 300원 ','용산구','서울특별시 용산구 효창원로 177-18','02-2199-7608'),(26,'감로천생태공원(관악산)','감로천 생태공원내 생태연못은 도시화로 훼손되어 사라진 자연적인 습지를 대신하여 다양한 생물들이 서식할 수 있는 인공습지 유형 중의 하나로 자연수림의 복원은 물론 기존 지형을 이용하여 지역 주민들이 일상적인 생활에서 쉽게 이용할 수 있는 공간으로 조성되어져 있으며 목재 데크에서 연못의 수생식물과 다양한 동?식물 등을 관찰할 수 있고 황톳길을 따라 산책하기 좋다.','버스(G 지선 B 간선 R 광역 Y 순환) 독산4동 주민센터 앞에서 하차 → 정심초등학교 방면 10분 G 5620 5619 독산정훈단지 앞에서 하차 → 정심초등학교 방면 15분 B 505 마을버스 → 8번(금천문화체육센터 정문앞 하차)  문의전화 금천구청 공원녹지과 ☏2627-1653  주차장 주차가능 수 : 15대 주차장 면적 : 약 400㎡ ','금천구','서울특별시 금천구 독산4동 371?375 373일대','02)2627-2395~7'),(27,'개운산근린공원','개운산공원은 1940년 3월 12일 지정된 마을동산 성격의 산지형 공원이다. 돈암동 안암동 종암동 등으로 둘러 쌓여 있으며 성신여자대학교와 고려대학교가 인접하여 있고 면적은 297926㎡이며 공원인근에는 개운산스포츠센터가 위치하고 있다. 산 형세는 자연스런 형태로 힘들지 않게 산책할 수 있으며 운동장이 있어 축구 게이트볼 배드민턴 테니스 등 운동을 할 수 있다. 전에는 아까시나무와 현사시나무가 많았으나 도시환경림 조성으로 불량수목을 제거하고 잣나무 참나무류 팥배나무 산벚나무 등 많은 수목 등이 자라고 있다. 개운산은 나라의 운명을 새롭게 열었다는 뜻의 개운사 절이 있어 붙여진 이름이다. 또 안암동에 있어‘안암산’으로 종암1동의 진씨(陳氏) 성을 가진 사람의 채석장이 있어‘진석산(陳石山)’으로도 불리운다. 공원내에는 향토수목 32종 3290주가 식재되어 있어 자연학습관찰로를 조성하여 어린이 및 학생들이 이용하고 있다. 개운산운동장에는 2003년에 66m의 지압보도와 정자 및 핸드레일을 설치하고 주변에 나무를 심어 가족이 함께 운동과 휴식을 겸할 수 있는 공원으로 많은 시민들이 이용한다.','지하철 4호선 성신여대역(6번출구) 6호선 고려대역(2번출구)  버스(G 지선 B 간선 R 광역 Y 순환) G 성북20번 개운중학교 하차 B 103108109152 미아리고개 하차 ','성북구','서울특별시 성북구 북악산로 949-73(돈암동 6-1)','02-2241-3667'),(28,'개웅산근린공원','개웅산공원은 서울시 개봉동 일대와 오류동에 인접한 개웅마을의 지형이 움푹 들어간 관계로 난리 때마다 총탄이 개웃개웃 피해 가서 개웅마을이라 불리고 산 이름도 붙여졌다고 한다. 서울시의 오류동과 개봉동 경계에 위치하고 능선이 세 방향으로 뻗어 내려 삼각형 모양을 이루고 있는 산으로서 산 전체가 단풍나무 아까시나무 소나무 참나무 등 다양한 식생이 잘 보존된 전형적인 자연상태의 공원이다.  연간 100000여 명의 시민들이 개웅산을 이용하고 있으며 등산로 주변에 약수터와 배드민턴장 체력단련장 허리 돌리기 등 운동기구와 의자 등 휴게시설이 등산로 곳곳에 설치되어 많은 시민들로부터 좋은 반응을 얻고 있다. 매년 이용시민의 수가 늘어남에 따라 2006년에 쾌적하고 아름다운 공원으로 조성하였다. ','지하철 1호선 개봉역 하차 후 마을버스 구로03 ','구로구','서울특별시 구로구 오류동 산13-1','02-860-3086'),(29,'경희궁','경희궁(慶熙宮)은 조선 후기의 이궁(離宮)이었다. 1617년(광해군 9)부터 짓기 시작하여 1623년(광해군 15)에 완성 하였다. 경희궁의 처음 명칭은 경덕궁(慶德宮)이었으나 원종의 시호인 경덕(敬德)과 같은 발음이라 하여 1760년(영조 36) 경희궁으로 바뀌었다. 경희궁은 도성의 서쪽에 있다고 하여 서궐(西闕)이라고도 불렀는데 이는 창덕궁과 창경궁을 합하여 동궐(東闕)이 라고 불렀던 것과 대비되는 별칭이다. 인조 이후 철종에 이르기까지 10대에 걸쳐 임금들이 경희궁에 머물렀는데 특히 영조는 치세의 절반을 이곳에서 보냈다. 경희궁에는 정전인 숭정전을 비롯하여 편전인 자정전 침전인 융복전 회상전 등 100여 동의 크고 작은 건물이 있었다. 그러나 일제가 대한제국을 강점하면서 경희궁은 수난의 역사를 맞이하였다. 1910년 일본인 학교였던 경성중학교가 들어서면서 대부분의 궁궐 건물이 헐려 나갔고 그 면적도 절반 정도로 축소되어 궁궐의 모습을 잃어버렸다. 서울특별시에서는 경희궁지에 대한 발굴을 거쳐 숭정전 등 정전 지역을 복원하여 2002년부터 시민들에게 공개하고 있다. ','지하철 5호선서대문역 4번출구 광화문역 7번출구 도보 5?10분  주차장 주차가능 수 : 146 대 주차장 면적 : 3171㎡ ','종로구','서울특별시 종로구 새문안로 55(신문로2가 2-1)','02-2148-4144'),(30,'국립현충원','동작구 동작동에 위치한 국립현충원은 국가와 민족을 위해 순국한 호국영령들이 잠들어 있는 민족의 성역이다. 이곳은 관악산 기슭의 공작봉을 주봉으로 하여 정기어린 능선이 병풍치듯 3면을 감싸고 앞으로는 한강수가 굽이쳐 도는 풍수상 명당으로 손꼽히는 포근한 땅이다. 2003년 현재 국립현충원에는 국가원수 2위 임정요인 17위 애국지사 1693위 국가유공자 120위 장군 513위 장.사병 73919위 경찰 2886위의 묘소와 108793위의 위패를 봉안하고 있다.','지하철 4호선 동작역 하차(24번출구) 도보 5분 9호선 동작(현충원)역 하차(8번 출구)  버스(G 지선 B 간선 R 광역 Y 순환) G 4511 5524 6411 R 8342 360 361 362 363 462 640 642 R 9408  승용차 경부 고속도로 : 반포IC지나서 올림픽도로 김포공항 방향 → 반포대교 지나 국립서울현충원 방향(약 3분) 중부고속도로 : 하남IC지나서 올림픽도로 김포공항 방향 → 반포대교 지나 국립서울현충원 방향(약3분) 해안 고속도로 : 서서울톨게이트 → 성산대교 방향 → 노들길 국립서울현충원 방향(약15분) 경인 고속도로 : 신월IC지나서 국회의사당 방향 → 노들길 수산시장. 국립서울현충원 방향(약10분) 강변북로(일산) : 동작대교 진입 남단에서 국립서울현충원 방향(약2분) 강변북로(천호 동부간선도로(의정부 상계동) : 성수대교 → 올림픽도로 김포공항 방면 국림서울현충원  주차장 100대 주차 가능 면적 : 2000㎡  문의처 국립서울현충원 02)815-0625 ','동작구','서울특별시 동작구 사당2동 산41-2','02-826-6235'),(31,'계남근린공원','휴식공간 양천구 신정동과 구로구 고척동 일대의 옛지명인 부평군 계남면의 지명을 따서 계남공원으로 명명되었으며 계남은 계양산의 남쪽에 위치하였다는 뜻으로 전해진다. 계남공원내 정랑고개는 양천구청에서 금옥여중 고등학교로 넘어가는 고개를 말한다. 정확한 이름과 유래는 알 수가 없으나 사람들은 이 고개를 정릉 정랑 정녕 등으로 제각기 부르고 있다. 옛날 장안에서 인천까지 걸어가는 지름길로서 넘은 첫고개이며 그 옆은 성넘어라 부르고 있다. 그런데 사람들은 정랑고개가 옛날 신기(신트리)마을 근처에 있다하여『신트리고개』라고 부르는 사람도 있다.','지하철 5호선 양천구청역 신정네거리역  버스(G 지선 B 간선 R 광역 Y 순환) 오목교 역 ? 금옥여고 앞 G 6640 오목교 역 ? 서부트럭터미널 G 5012 양천구청 ? 금옥여고 앞 G 662066236640  주차장 주차가능 수 : 40대 주차장 면적 : 480㎡ ','양천구','서울특별시 양천구 신정동 산44-2일대','02-2620-3575'),(32,'고척근린공원','1988년 12월에 조성한 구로구의 유일한 종합공원으로 도서관 체육센터 경로당 축구장 테니스장 배드민턴장 광장 야외무대 시설이 있으며 연평균 50000명이 이용하고 있다.   공원 전체 면적 중 약 25000㎡가 임야 상태로 보존되어 있고 산책로 주변에는 운동시설이 있으며 고척도서관은 1988년 12월에 개관하여 176000권의 장서와 864개 좌석을 보유하고 운영 중에 있다. 또한 1993년 12월에 개원한 구로구민체육센터는 실내 수영장 체력단련장 에어로