서울특별시 성북구 화랑로18가길 50','02-2241-3683'),(48,'초안산근린공원','초안산은 114.1m 봉우리를 중심으로 북서쪽 도봉구 창동(면적:673166㎡) 남동쪽은 노원구 월계동(면적:950643㎡) 일대에 걸쳐 있으며 1971년 8월 6일 건설부 고시 제465호로 공원으로 지정되었고 1997년 10월 30일 공원 명칭이 월계공원에서 초안산공원으로 바뀌었다. 동쪽 기슭 월계 2동 766번지 일대를 능골 또는 능동이라 부르는데 조선 명종 때 청백리였던 이명의 묘와 신도비가 있기 때문이다. 그리고 이명 신도비 옆에는 예안 이씨의 전통가옥이 보존되어 있다. 5만 평 정도의 나지막한 야산인 초안산은 114.1m 봉우리와 102.5m 봉우리 사이에 약 100기의 조선시대 내시들 무덤이 있으며 현재는 배드민턴장과 각종 체육시설이 갖추어져 있고 남쪽으로는 약수터가 있어 인근 주민의 휴식처가 되고 있다. ','지하철 1호선 녹천역 → 도보이용 1번출구 초안산근린공원 방면 548m걷기  버스(G 지선 B 간선 R 광역 Y 순환) G 1138 창동주공3단지 하차 G 1120 1127 1157 도봉01 창동청구빌라 하차  승용차 시청 → 세종로사거리 우측 → 종로5가 이화사거리 → 혜화동사거리 → 미아사거리 → 정의여중 → 창원초교 → 초안산근린공원 입구  주차장 주차가능 수 : 40 대 주차장이용시간 : 24시간 운영 (09:00-24:00는 유료 연중무휴) ※ 주차요금 정기권은 할인이 되지 않습니다. ','도봉구','서울특별시 도봉구 창동 산157','02-2091-3754'),(49,'동명근린공원','북으로 고덕산과 한강이 흐르고 남?동쪽으로도 크고 작은 산이 있어 서울의 여타 지역보다 맑은 공기를 마시며 뛰어놀 수 있고 심신을 단련할 수 있는 장소로는 그만이다. 주요 시설로는 축구장 족구장 배드민턴장 농구장이 있으며 그중에서 가장 인기가 높은 시설은 축구장이며 2006년에는 연 이용 건수가 1158건 2007년에는 1920건으로 이용이 급증하고 있다. 축구장 바로 근처에는 배구장 족구장 농구장 배드민턴장이 있어 축구시합과 함께 각종 체육을 즐길 수 있는 시설이 겸비 되어 있다. 인조잔디 축구장 과거에는 흙으로 되어 있던 축구장을 인조잔디 축구장(7140m2)으로 조성하고 외곽으로는 트랙을 설치하여 20031211일에 개장하였다. 지역주민에게 다양한 생활체육 및 여가활동의 기회를 제공하고 청소년의 건전한 여가활동의 장을 마련하였다.','지하철 5호선 상일역 하차  버스(G 지선 B 간선 R 광역 Y 순환) G 3412 3411 B 340342 ','강동구','서울특별시 강동구 고덕2동 229','02-3425-6444'),(50,'마로니에공원','마로니에 공원은 대학로 옆 옛 서울대학교 문리대 법대자리에 위치한 넓이 5802㎡로써 문예회관 및 대학로 길거리에 작품들이 전시되어 있어 꿈과 낭만이 어린 문화예술의 거리로 독특한 분위기를 자아내고 있다. 또한 공원내에는 야외무대가 마련되어 음악콘서트 무용 연극등이 수시로 열리며 곳곳에 젊은이들의 만남의 광장 대화의 장소로 인기가 매우 높다. 2002월드컵축구대회때는 마로니에공원과 대학로에서 많은 인파속에 열렬히 응원했던 장소로도 유명하다.  인근에는 성균관대 성신여대 한성대학 등이 위치해 있고 현재는 많은 다양한 계층의 사람들이 이용하는 곳으로 탈바꿈되었다. 특히 공원내 심어져 있는 마로니에 나무는 웅장한 고목으로 공원의 상징 기념수로 알려져 있다.','지하철 4호선 혜화역 2번출구 도보2분 ','종로구','서울특별시 종로구 대학로8길 1','02-2148-4158'),(51,'자매근린공원',' 앙카라공원이라고도 하며 1971년 8월 23일 서울시와 터어키 앙카라시의 자매결연 체결을 기념하기 위하여 터어키의 풍물이 담긴 주제공원으로 조성하여 1977년 5월 1일에 개원하였다. 이보다 앞서 1973년 10월 앙카라시에도 10000㎡규모의 한국공원을 조성하여 개원한 바 있다.','지하철 1호선 대방역 도보 8분거리 5호선 여의도역 도보 10분거리  버스(G 지선 B 간