규모 암반이 노출되어 있던 곳을 1992년에 공원으로 조성하였다. 공원 내 50년 넘게 공원경관을 저해하던 위생 병원 담장을 철거하고 그 자리에 야생화 단지 생태연못 지압보도 등을 설치하여 자연학습장을 및 주민 휴식공간으로 조성하였다. 그밖에 어린이 놀이터 및 야외공연장 각종 운동시설 4km의 산책로가 있어 지역주민의 생활문화 향상 및 여가생활의 장으로 활용되고 있으며 부족한 녹지공간 확보를 위해 기존 공원과 중랑천 제방을 연계한 녹지 순환길을 조성하고자 배봉산근린공원 내 산책로를 보완 정비하고 중랑천 길과 연계한 보도 육교를 연결하여 명실공히 동대문구의 체계화된 중심공원으로 거듭나고 있다. 매년 5월에 구민 걷기대회가 열리고 또한 사생대회 문화 관련 음악행사 체조교실 등 다양한 이용 프로그램을 진행하고 있어 공원 이용이 활성화된 곳이다. ','버스(G 지선 B 간선 R 광역 Y 순환) 전농동SK아파트에서 하차 도보 5분 소요 G 2015 2233  승용차 전농동로터리에서 장안교 방향으로 약 200M  주차장 주차가능 수 : 20대 주차장 면적 : 1000㎡     접근방법(교통)  배봉산자락길 맨발로 걷는 황톳길  ? 배봉산연육교 입구 : 145번 휘경유수지견인차고지앞 하차  순환산책로           ? 관리사무실 입구 : 2015번 2230번 2233번 2311번                                   전농동SK아파트 하차          ? 배봉산연육교 입구 : 145번 휘경유수지견인차고지앞 하차 ','동대문구','서울특별시 동대문구 한천로43길 12-14(배봉산공원) ','02-2127-4398'),(57,'안산도시자연공원','해발 295.9m의 안산은 인왕산에서 서쪽으로 비스듬히 뻗어 무악재를 이루고 솟은 산이다. 길마재의 다른 이름인 무악재는 모악재로 부르기도 하였으며 조선왕조가 개창 되어 도읍을 한양으로 옮기면서 무악은 궁궐의 주산(主山)으로 주목되기도 하였다. 식생은 연희동 지역인 서 남측 연희동 지역은 자작 산벚 물푸레 잣나무 등 1990년도부터 환경림으로 양호한 수림을 형성하고 있으며 북동부 암반지역은 왜소한 소나무 산정부 일대는 팥배 상수리 오리나무가 분포하고 남동 측 임야는 대규모 아까시나무 군락을 형성하고 있다.','지하철 2호선 신촌역 3번출구 → 마을버스 \'서대문03\'번 → 서대문구청 하차 3호선 홍제역 3번출구 → 버스 7713 7738 7739번 → 서대문구청 하차 서대문구청 옆길로 올라가면 안산 주요 등산로 입구 나옴  버스(G 지선 B 간선 R 광역 Y 순환) 서대문구청 하차 G 7017 7713 7720 7738 8153(맞춤버스) 마을버스 서대문03 B 110B 153 567  주차장 주차장이 없으므로 대중교통을 이용하시기 바랍니다. 문의처 : 서대문구청 푸른도시과 (02-330-1395) ','서대문구','서울특별시 서대문구 홍제동 산33-98','02-330-1958'),(58,'염창근린공원','서울특별시 강서구 염창동 주민들의 휴식처인 염창공원은 한강조망이 아주 뛰어난 공원이다. 염창산에 관련된 옛 고전에는 염창산이 증산으로 표기되어 있다. 원래 이름은 ‘일찍 증(曾)’ 자가 아닌 ‘건질 증(拯)’ 자이며 그 유래는 곡식을 실어오던 세곡선(稅穀船)이 강화만을 통해 거슬러와 용산으로 가던 도중 이곳 염창산에서 자주 좌초되었는데 이때 곡식을 건지는 사람들이 모여 살았다 하여 증미(拯米)산이라 했고 이 말이 줄어 증산(拯山)이 되었다. 증산 아래에는 한양으로 들어 갈 소금창고가 있었던 관계로 오늘날 염창산(鹽倉山)이라 불리게 되었다.','지하철 가양동 이마트 하차(도보10분) 9호선 증미역  버스(G 지선 B 간선 R 광역 Y 순환) 가양동 이마트 하차(도보10분) G 6631 6712 가양동 이마트 하차(도보10분) B 660  문의처 강서구청 공원녹지과 02-2600-4186 ','강서구','서울특별시 강서구 염창동 산24-1','02-2600-4186'),(59,'백련근린공원','백련산 정상(높이 215.5m)에서 능선을 경계로 서대문구와 은평구로 나누고 있으며 백련산은 동남쪽에 백련사(白蓮寺)라는 절이 있어 붙여진 이름으로 예부터 동쪽의 청련사(靑蓮寺) 남쪽의 삼막사(三幕寺) 북쪽의 승가사(僧伽寺)와 함께 서백련(西白蓮)으로서 도성의 4대 비보사찰(裨補寺刹) 가운데 하나로 전해지고 있다. 전설에 의하면 이 절의 서쪽에 있어서 \'西方淨 淨土寺\'라고 하였는데 어느 여름날 연못에서 갑자기 하얀 연꽃이 피어올라 백련사라 명칭을 바꾸었다고 한다. 백련산 정상(높이 215.5m) 등산로 주변에 체력단련시설이 잘 갖추어져 있어 많은 시민들이 이용하고 있다.','지하철 2호선 신촌역 3번출구 → 마을버스 \'서대문03\'번 → 서대문등기소 하차후 → 서대문문화회관방면으로 도보 5분 3호선 홍제역 3번출구 → 마을버스 \'서대문10번\' 이용 백련사 하차 3호선 녹번역 4번출구 → 7019번 이용 시립은평병원 하차 3호선 홍제역 녹번역 하차 도보 10~15분  버스(G 지선 B 간선 R 광역 Y 순환) 서대문등기소 하차 G 마을버스 서대문03 백련사 하차 G 마을버스 서대문10 시립은평병원 하차 G 7019  주차장 주차가능 수 : 74대 주차장 면적 : 2775㎡ 문의처 : 서대문구청 푸른도시과 (02-330-1395)  문화체육회관 (02-360-8500) ','서대문구','서울특별시 서대문구 통일로 507-22(백련공원) ','02-330-1776'),(60,'오금근린공원','오금공원은 지하철 5호선 오금역에 인접해 있으며 가락동 송파경찰서 대각선 방향 오금동 송파우체국 건너편에 자리하고 있다. 오금공원은 해발200m의 야산을 친환경적으로 조성한 공원으로 갖가지 나무와 꽃 잔디가 어우러져 몸과 마음을 상쾌하게 해준다. 또한 야생 초화류 30여정과 자생 관목류 20종이 자라고 있는 자연학습장이 조성되어 있어 산책을 하며 다양한 식물을 관찰할 수 있다. 광장 5곳과 어린이놀이터 산책로 9코스가 있어 지역주민들의 발길이 끊임없이 이어지고 있으며 운동장 정구장 수영장 배드민턴장 게이트볼장 체력단련장 인라인하키장 등의 운동시설은 인근 주민들과 학생들의 체력단련 및 휴식처로 사랑받고 있다.','지하철 5호선 오금역 2번 출구에서 횡단보도 건너 오른쪽으로 100m 직진 5호선 5호선 개롱역 1번 출구에서 횡단보도 건너 송파우체국방향으로 100m 직진  버스(G 지선 B 간선 R 광역 Y 순환) 오금공원앞 가락레미안앞 하차 G 3215 3219 3313 3314 3315 3417 ','송파구','서울특별시 송파구 오금로 363 오금근린공원 ','02-400-0978'),(61,'오동근린공원','오동공원은 서울 강북구와 성북구에 걸쳐 있으며 강북 번동?미아동 외 5개 동과 성북구 월곡동에 걸쳐 있는 대단위 공원으로 수림이 잘 형성되어 있어 인근 주택단지에 주거하고 있는 주민들의 휴식과 운동 장소로 이용되고 있다. 일부 지역인 드림랜드는 2007년 10월 강북 대형공원 조성계획으로 드림랜드 내 전체 시설물(놀이시설 및 운동시설 등)은 철거되고 2008년 8월까지 설계용역 완료하여 공원 조성계획 변경 후 2012년까지 강북 대형공원을 조성할 계획이며 나머지 지역은 휴양과 운동 그리고 편익시설을 갖춘 체계적이고 효율적인 공원이다.','지하철 4호선 수유역 : 2번출구 ⇒ 마을버스 9번 11번 이용 강북구민운동장에서 하차 오동공원 이용 주공아파트 508동 하차 오동공원 이용  버스(G 지선 B 간선 R 광역 Y 순환) B 150번 142번 140번 등 강북구청(수유역)에서 하차 ⇒ 수유역 2번출구 ⇒ 마을버스 9번 11번 이용  주차장 공원 옆 강북구민운동장 유료주차장 이용하시면 됩니다. ','강북구','서울특별시 강북구 번동 산20-1','02-901-6923'),(62,'봉산도시자연공원','서울시 은평구와 경기도 고양시에 걸쳐위치하고 있는 공원으로 남으로 매봉산 월드컵공원 동으로 백련산 북한산과 연결되는 주택가 생활권 주변에 위치한 공원이다. 가장 높은 봉우리가 210m로 경사가 완만하고 접근이 쉬워 산정상과 능선을 따라 등산로가 발달되어 많은 주민들이 이용하고 있으며 주요 시설로는 1459년 창건된 조성왕조의 전통사찰인 수국사와 약수터 4개소 주요 등산로변에 운동.편의시설 600여점이 설치되어 등산객 등 이용자에게 편의를 제공하고 있다.  봉산은 산 이름에서 느낄 수 있듯이 예로부터 주요 통신수단의 하나인 봉화가 변방에서 중앙으로 전달되는 매우 중요한 길목이었다. 문헌에 나타난 기록을 체계적으로 발굴.정리하여 봉수대를 건립코자 추진중에 있으며 조선왕조의 예종 숙종을 비롯한 왕후의 묘(창릉 명릉 익릉 홍릉 경릉)가 있는 서오능이 인근에 위치하고 있다.','지하철 6호선 응암역 새절역 증산역 수색역 이용  버스(G 지선 B 간선 R 광역 Y 순환) G 7017 7715 7212  접근방법(교통) 제1등산로 : 경의선 수색역(1번출구) - 도보 10분 제2등산로 : 지하철 6호선 증산역(3번출구) - 도보 10분         ※ 주 등산로만 작성 ','은평구','서울특별시 은평구 구산동 산61','02-351-8003'),(63,'온수도시자연공원','서울시의 남서 측 양천구와 구로구에 걸쳐 있고 경기도는 부천시와 접하고 있으며 남쪽으로 경인국도 동쪽으로 남부순환로 북쪽으로 경인 고속국도와 접하여 접근이 매우 용이하고 1971년 공원으로 지정되었으며 임상이 양호하며 식생이 다양하게 잘 보존된 전형적인 자연형 공원으로 년 180000여 명의 시민이 이용하고 있으며 등산로 주변에 약수터와 배드민턴장 체력단련장 의자 등 휴게시설과 철봉 허리 돌리기등 운동기구가 등산로 곳곳에 설치되어 많은 시민들로부터 좋은 반응을 얻고 있다.   ','지하철 1호선 개봉역 2번출구>마을버스02 종점하차(개봉중) 미소들병원 방향(도보5분)  버스(G 지선 B 간선 R 광역 Y 순환) G6613 ','구로구','서울특별시 구로구 개봉동 산2-60','02-860-2396'),(64,'봉은공원','봉은사가 위치하고 있어 불교 관련 체험행사가 풍부하며 대방광불화엄경(大方廣佛華嚴經) 수소연의 초판 秋史 金正喜가 만년에 쓴 \'板殿\' 현판과 선불당이 문화재로 지정되어 있는 사적공원이다.','지하철 2호선 삼성역 하차 7호선 청담역 하차 도보로 10분 소요 ','강남구','서울특별시 강남구 삼성동 75','02-2104-1902'),(65,'올림픽공원','1988년 서울올림픽을 기념하기 위해 조성된 곳으로 6개의 경기장이 있는 체육공원과 백제초기 문화유적인 몽촌토성을 중심으로 크게 두 지역으로 나누어져 있다. 올림픽공원은 야외조각공원을 겸하고 있어 세계 유명 조각 작품들을 만나볼 수도 있고 88놀이마당 음악 분수 등 휴식공간이 조성되어 있다.','지하철 2호선 잠실역 성내역 5호선 올림픽공원역 8호선 몽촌토성역  버스(G 지선 B 간선 R 광역 Y 순환) G21-2 21-3 21-5 571 522 418 30-5 212 813-2 ','송파구','서울특별시 송파구 올림픽로 424 (방이동)','02-410-1114'),(66,'와룡근린공원','와룡근린공원은 삼청근린공원 창경근린공원 북악산 도시자연공원이 연접해 있는곳으로 용(龍)이 길게 누워있는 형상을 하여 와룡동이라고도 하고 1914년 부제(府制) 실시에 따라 이전 중부 정선방의 이동(泥洞) 누동(樓洞) 수문동(水門洞) 승문동(承文洞) 마동(麻洞)의 각 일부를 병합하여 창덕궁 돈화문이 있는 지대이므로 나라의 상서(祥瑞)인 와룡(臥龍) 봉익(鳳翼)의 이름을 따서 와룡동이라고 하며 동에서 서로 길게 늘어져 있다. 와룡근린공원은 토심이 얕아 수목생육이 어렵고 아카시나무 등으로 산림이 조성되었으나 주민들이 생명의나무 천만그루 심기 행사에 스스로 참여하여 수목을 심고 가꾸어 푸르름과 계절별 아름다운 꽃이 피는 공원으로 변모하고 있다.','지하철 4호선 대학로역 하차 혜화초등학교행 마을버스  버스(G 지선 B 간선 R 광역 Y 순환)','종로구','서울특별시 종로구 와룡공원길 192 (우) 03063','02-2148-4150'),(67,'봉화산근린공원','봉화산은 중랑구 묵동.신내동.상봉동에 접하여 있고 정상까지 높이는 160.1m로 평지에 돌출되어 있는 독립구릉이다. 동쪽에 아차