리고 있다.','지하철 2호선 합정역 4번출구  버스(G 지선 B 간선 R 광역 Y 순환) B361 ','마포구','서울특별시 마포구 양화진길 46(외국인묘지공원)','02-3153-9554'),(71,'불광근린공원','북측으로는 수려한 북한산이 위치하고 서측으로는 봉산 월드컵공원 등 녹지축에 이어 수도 서울의 자랑인 한강과 이어지며 통일로 불광로 등 간선도로와 주거 밀집지역으로 둘려 쌓여 있는 도심 생활권내 근린공원이다. 공원을 중심으로 주택 학교 등 다중이용시설이 밀집되어 있어주민들에게는 산책과 여가활용 장소로 학생들에게는 자연학습 장소로 활용되고 있는 등 실질적인 근린생활자의 녹지 쉼터로 이용되고 있다. 주요시설로는 380석 규모의 구립도서관이 공원 산자락에 위치하고 운동시설과 편익시설 72점이 주요 등산로변에 설치되어 이용객에게 편의을 제공하고 있다.','지하철 3호선 6호선 연신내역 3번 출구 불광미성아파트 뒤  버스(G 지선 B 간선 R 광역 Y 순환) G 7723 7211 B 720 571  문의처 02)351-8001~8006 ','은평구','서울특별시 은평구 불광동 산33-1','02-351-8004'),(72,'불암산도시자연공원','불암산은 서울과 경기 남양주의 경계를 이루며 덕릉고개를 사이에 두고 수락산과 이웃하고 있는 산이다. 불암산은 사암으로 된 산이라 수목이 울창하지는 않지만 능선은 기암으로 이어지고 봄의 철쭉은 화원을 연상케 한다. 북한산과 더불어 암벽등산 훈련 코스로 적당한 곳이어서 휴일이면 암벽 장비를 둘러맨 클라이머들이 끊이지 않고 찾는다. 정상에서는 북한산 도봉산 비봉 보현봉 등이 눈앞에 펼쳐진다.','지하철 4호선 상계역 하차 도보 10분거리 불암산 방향  문의처 노원구청 공원녹지과 (02)2116-3942~68  주차장(불암산 주차장) 위 치 : 중계동 산26번지 면 적 : 2000㎡(약606평) 주차면수 : 67면   접근방법(교통) 제1등산로 : 4호선 당고개역 하차 (도보로 15~20분 소요) 제5등산로 : 4호선 상계역 하차   (도보로 10~15분 소요) 제9등산로 : 6호선 화랑대역 하차 (도보로 10~15분 소요)   ','노원구','서울특별시 노원구 한글비석로12길 51-33(불암산공원) ','02-2116-3943'),(73,'용마폭포공원','경기도 구리시와 중랑구 망우동 광진구 중곡동 광장동에 광범위하게 걸쳐 있는 공원으로 산이름은 아차산(峨嵯山)으로 이는 원래 명칭은 阿旦山인데 임금이름을 피하여 아차산(亞且山)으로 불렀다. 이후 『세종실록』지리지에 지금의 이름인 峨嵯山으로 정착되었으며 용마공원은 아차산의 최고봉이 용마봉의 이름을 따서 지어졌으며 중랑구쪽은 용마랜드 놀이동산이 있으며 광진구쪽은 워커힐이 있어 산위에 올라보면 서울시 전체를 내려다 볼 수 있고 한강의 푸른물과 강변의 경관을 내려다 볼 수 있는 공원이다. 용마산은 해발 348m로 아차산의 최고봉으로 면목동 동편에 위치하고 있으며 망우리공원 중곡동 간의 산능선을 따라 이어지는 등산로를 통해 망우리에서 아차산성을 거쳐 어린이 대공원 후문 근처까지 이어진다. ','지하철 7호선 용마산역 2번 출구 5호선 아차산역 1번 출구  버스(G 지선 B 간선 R 광역 Y 순환) 용마폭포공원 하차 G 1213 2012 B 320  주차장 주차가능 수 : 72 대 주차장 면적 : 2400㎡ ','중랑구','서울특별시 중랑구 면목동 산1-4 ','02-2094-2965'),(74,'사육신공원','단종을 모시던 신하들로서 벼슬과 목숨을 초개같이 여기고 단종 복위 모의를 꾀하다가 배반자의 밀고로 발각된 후 능지처사를 당한 하위지 성삼문 류성원 이개 유응부 박팽년 김문기 일곱 분의 묘가 이 공원에 모셔져 있으며 묘역 앞 건물에는 위 일곱 분의 위패를 모신 사당 의절사가 있고 의로운 충혼을 위로하고 불굴의 충의(忠義) 정신을 널리 기리고자 매년 10월 9일에 추모제향을 올리고 있다. 사육신공원은 1978년 5월 19일에 개원되었으며 공원 내의 사육신 묘는 서울특별시 유형문화재 제8호로 지정되었다. ','지하철 1호선 노량진역 하차(1번출구) 도보 10분 버스(G 지선 B 간선 R 광역 Y 순환) 사육신공원에서 하차 G 50115516551755315535553662116411 B 150152360361363500504507605640751 R 94089412 문의처 동작구청 공원녹지과 02)820-1395 주차장 소형 5대 대형 1대 주차 가능 주차장 면적 : 350㎡ ','동작구','서울특별시 동작구 노량진로 191','02-820-9844'),(75,'용왕산근린공원','옛 지도상에는 엄지산(嚴知山)으로 기록되어 있으며 엄지의 뜻은 순수한 우리말인 첫머리로 비교되기에 지형적으로 천호지(千戶地)벌에서 초입(初入)에 위치한 산으로 뒤편에 있는 마을을 두고 지금도 엄지미마을이라고 불려지고 있다. 용왕산의 또 다른 이름으로는 어느 때인가 확실한 시기는 알 수 없으나 박씨 성을 가진 사람이 죽어서 왕으로 환생하려다 뜻을 이루지 못하였다는 야사가 전해짐에 따라 그때부터 엄지산을 용왕산 왕령산 왕재산 등의 임금 \'왕(王)\'자가 포함된 산 이름으로 고쳐 부르게 되었다. 전설의 시기를 추정해 본다면 600년 전의 지도에 엄지산으로 표기되어 있는 것으로 보아 조선시대부터 유래되었던 것으로 볼 수 있다. 그밖에 산의 형태가 한양을 등지고 돌아앉아 있다하여 역산으로 불리어지기도 하였다. 현재는 체육공원시설이 마련되어 있으며 이 산 중턱에는 약수터와 목동 배수지가 있어 주민들의 산책길로 이용되고 있다.','버스(G 지선 B 간선 R 광역 Y 순환) 양천구청 ? 신목동역 G 6620 B 571 신월사거리 ? 신목동역 G 6627 B 661 607  지하철 9호선 신목동역 1번 출구에서 15분  주차장 주차가능 수 : 40대 주차장 면적 : 480㎡ ','양천구','서울특별시 양천구 목동 199-51','02-2620-3574'),(76,'사직근린공원','조선 태조가 한양에 수도를 정하고 궁궐 종묘를 지을 때 함께 지은 사직단이 있는 곳으로 1921년 사직단 주변이 공원으로 조성되었다. 사직단은 태조3년(1394)에 고려의 예를 따라 토신을 제사하는 국사단을 동쪽에 곡신을 제사하는 국직단은 서쪽에 배치하고 신좌를 북쪽에 모셔 1년에 세번 제사를 지냈다. 구한말 마지막까지 남아 있었던 궁술연습장이었던 황학정은 건평 59㎡에 정면4칸 측면2칸에 팔작지붕이며 우측으로부터 2칸 추녀 밑에 황학정이라는 현판이 걸려 있다.','지하철 3호선 경복궁역(1번 출구) 도보 3분  버스(G 지선 B 간선 R 광역 Y 순환) 150 152-1 159 2 205 205-1 588-2 1000 158  문의처 종로구청 공원녹지과 02-2148-2894 / 사직단 관리사무소 02-739-7205 ','종로구','서울특별시 종로구 사직로9길 5','02-2148-2834'),(77,'우장산근린공원','우장산은 강서구 중앙에 위치하여 도심 속에서 숲과 예술공간 체육시설 등이 조화롭게 어우러진 공원이다. 산 이름은 옛날 가뭄이 들었을 때 양천 현감이 기우제를 올린 데서 유래한다. 기우제는 세 번에 걸쳐 올렸는데 세 번째 기우제를 올리는 날에는 비가 쏟아지기 때문에 미리 비옷을 준비해 올라갔다 하여 우장산(雨裝山)이라 하였다 한다.  공원에는 두 개의 봉우리가 있는데 서울 정보 기능대학이 있는 봉우리를 원당산 새마을지도자탑이 있는 봉우리를 검두산(또는 검덕산 검지산 검둥)이라 불렸으나 지금은 모두 우장산이라 부른다. 그리고 자연생태가 다양한 탐방코스를 걸으며 숲해설가로부터 숲 속의 식물 곤충 동물 등 생태해설을 들으며 자연놀이도 즐길 수 있는 자연체험교실이 7월부터 12월까지 매월 둘째 주 토요일 오전 10시부터 12시까지 우장산에서 운영되고 있어 지역주민들로부터 많은 호응을 받고 있다. ','지하철 5호선 우장산역(도보 10분)  버스(G 지선 B 간선 R 광역 Y 순환) 강서구청 앞 하차(도보 5분) G 5712 6627 6645 B 604 607 650 652 70-2 70-1  주차장 주차가능 수 : 100대 ','강서구','서울특별시 강서구 내발산동 산4-5','02-2600-4185'),(78,'삼일근린공원','한국 최초의 여기자인 최흔희씨가 3?1운동 당시 여성 참가자는 \'직접 일병의 총칼에 대결했던 홍안의 소녀들이 이제는 귀가 멀고 눈이 어둡고 허리가 굽은 할머니가 되었으나 나머지 기백을 다시 모아 망각속에서 사그라져 가는 그날의 분노와 저항을 되새기면서 쇠잔한 몸이지만 나머지 생애에서 무엇을 조국에 바칠 수 있을까\'하는 마음으로 1967년 4월15일 동아일보에 \'독립공원을 설립해야 한다\'는 글을 투고하고 박정희 대통령에게 건의 하였다. 정부는 1967년 5월15일 공원을 지정하고 1989년부터 1990년까지 공원을 조성 현재에 이르고 있다.','지하철 7호선 남성역(4번출구) 사당동 대림아파트 방향 도보5분  버스(G 지선 B 간선 R 광역 Y 순환) 150 152-1 159 2 205 205-1 588-2 1000 158  문의처 동작구청 공원녹지과 02)820-1395  주차장 없음 ','동작구','서울특별시 동작구 사당동 산24-17','02-820-9845'),(79,'삼청근린공원','삼청공원은 1940년 3월 12일자로 공원으로 지정되었는데 당신 고시된 140개 도시계획공원중 제1호로 삼청동은 깊은 골안에 도교의 삼청전(三淸殿) 즉 소격전(昭格殿)이 있었던 연유로 인하여 내려 온것이라고도 하고 혹은 산 물과 그곳에 사는 사람이 맑아서 삼청동이 되었다고 하기도 한다. 삼청공원은 호젓한 산책로에 주위 경치가 좋아 많은 사람들이 오가는 곳으로 고려충신 정몽주와 그이 어머니의 시조비가 있으며 공원입구에서 산책로를 따라 계곡을 서서히 올라가면 삼청공원 약수터가 나온다. 예부터 이름난 약수터를 찾는 시민들의 발길이 아직도 끊일줄 모르고 오염되지 않는 맑은 물을 맛볼 수도 있다. 특히 공원주변에 오래된 벚꽃이 많아 매년 4월경 아름다운 벚꽃을 구경하려는 시민들이 꾸준히 늘고 있으며 공원내 배드민턴장 테니스장 어린이 놀이터 다목적 공터 및 매점 등이 있어 공원을 이용하는 시민들에게 편의를 제공해 주고 있다.','지하철 5호선 광화문역하차 삼청동 마을버스  문의처 종로구청 공원녹지과02-731-1455 ','종로구','서울특별시 종로구 북촌로 134-1 (우) 03050','02-2148-4150'),(80,'인왕산도시자연공원','인왕산은 해발 338.2m로 화강암이 유난히 노출된 것이 특징이다 . 경북궁의 주산을 중심으로 인왕산은 서울 내사산(內四山)의 우백호에 해당되며 그안산(案山)인 남산은 능선이 매우 부드럽고 좌청룡인 동쪽의 낙산은 밋밋하고 얕은 지세이다 인왕산의 주봉은 둥글 넓적하면서도 남산같이 부드럽거나 단조롭지 않다. 또한 뾰족한 북악처럼 유달리 뛰어나지는 않지만 늠름한 남성적인 산세이다 인왕산은 불법의 수호신으로 사문(寺門) 또는 수미단 전면의 좌우에 안치하는 금강역사로서 둘 다 용맹하고 험악한 얼굴을 가지며 일명 이왕(二王) 또는 금강신(金剛神) 이라 한다. 이렇듯 인왕산은 불교와 밀접한 관계를 가지고 있다 인왕산에는 선바위를 비롯하여 바위의 형상이 실제의 사물과 유사한 기암괴석들로 가득하여 어느 때 올라 보아도 그때마다 느낌을 가질수 있는 명산이며 인왕산에 오르는 등산길로는 크게 8개노선의 중요 등산로가 있다. ','지하철 3호선 경복궁역 독립문역 하차 도보 15분  한양도성 탐방로(사직동) : 지하철 3호선 1번출구   버스(G 지선 B 간선 R 광역 Y 순환)     한양도성 탐방로(청운동) : 버스 1020번 7022번 7212번(윤동주문화관 하차)  탕춘대성 탐방로(홍지문) : 버스 1020번 7022번 7212번 1711번 7016번(상명대 입구 하차)   주 등산로와 정류장(지하철버스) 연계현황    인왕산 주 등산로은 한양도성탐방로와 탕춘대성 2개 노선으로 이루어져 있으며 인왕산을 찾는 사람은 보통 지하철 3호선 경복궁에서 도보로 사직공원을 경유하여 종로구 문화체육센타앞에서 출발하는 노선을 이용하고 있으며  반대로 지하철 3호선 경복궁역에서 하차 3번출 앞에서 후 버스로 환승 후  윤동주문화관에서 하차 청운동지점을 이용한다.   탕춘대성 노선은 사직동이나 청운동에서 출발하여 홍지문 방향으로 주로 이용하지만 반대로 버스를 이용하여 상명대 입구에서 하차하여 이용하는 방법도 있다.    ','종로구','서울특별시 종로구 옥인동 산 3-1 ','02-2148-2834'),(81,'상도근린공원','상도공원의 주봉인 국사봉(國思峰)은 글자 그대로 양녕대군이 이 산에 올라 나라를 생각하고 임금을 걱정했기 때문에 붙여진 것이다. 양녕대군은 왕세자로서 스스로 실적을 저질러 폐세자가 되어 왕의 자리를 동생에게 물려준 뒤 대궐에서 쫓겨났지만 그는 형제 간에 우애가 지극하여 이 산에서 멀리 경복궁을 바라보며 나라와 세종의 일을 걱정했다고 한다.','지하철 1호선 노량진역 하차 육교건너 마을버스 13번 승차 후 국사봉중학교 하차  문의처 동작구청 공원녹지과 02)820-1395  주차장 없음 ','동작구','서울특별시 동작구 성대로6사길 27-6(상도공원) ','02-820-1396'),(82,'일자산도시자연공원','일자산자연공원은 비교적 낮은 산지로 동고서저의 지형을 이루고 있으며 강동구 둔촌동과 하남시 초이동의 경계선에 위치하고 있다. 산 정상부가 기복이 거의 없이 일자(一字)처럼 생겨 일자산(一字山)이라는 이름이 붙었으며 정상에는 강동구가 서울에서 가장 먼저 해를 맞이하는 곳임을 상징하는 해맞이 광장이 위치하고 길동 배수지 위에는 2006년 허브와 천문을 테마로 한 허브-천문공원이 조성되었다. 2008년 3월에는 잔디광장 X-게임장 실외 농구장 실내배드민턴장 폭포 등이 조성되어 지역 주민들의 휴식공간으로 각광받고 있다. 일자산 내 길동생태공원은 도심 속에서 생태를 체험할 수 있는 공간을 제공하고 또한 둔굴에는 둔촌 이집 선생과 관련된 역사의 뿌리가 산재되어 있다.','지하철 5호선 강동역 둔촌역 하차 보도 20분  버스(G 지선 B 간선 R 광역 Y 순환) 보훈병원 뒤편 일자산입구역에서 하차 B 342  접근방법   - 일자산 제1등산로 (2.1㎞)  ? 5호선 둔촌동역에서 도보로 약 20분  ? 5호선 둔촌동역에서 강동01 마을버스 타고 둔촌현대3차아파트에서 하차 후 도보로 약 8분  - 일자산 제2등산로 (4.2㎞)  ? 5호선 둔촌동역에서 도보로 약 26분  ? 5호선 둔촌동역에서 3316 버스를 타고 서하남IC입구 정류장에서 하차    주차장 주차가능 수 : 98 대 ','강동구','서울특별시 강동구 동남로 660(일자산공원)','02-3425-6443'),(83,'쌍문근린공원','쌍문공원은 북동?서의 북한산과 도봉산의 지맥이 합류하는 곳에 위치하여 주 능선이 동서로 축을 형성하며 구릉지로 되어 있다. 전반적으로 급경사이며 부지 남쪽 쌍문로 인접 부분에 완만한 지형을 이루고 있다. 세심천 청심천 약수터 2개소가 있으며 아까시나무 리기다소나무 밤나무 상수리나무 신갈나무 굴참나무 군락이 있다.   ','지하철 4호선 쌍문역 → 1km걷기 A 쌍문근린공원입구 B 청소년문화회관 F 세심천지구입구 G 세심천지구  버스(G 지선 B 간선 R 광역 Y 순환) G 도봉07 도봉04 도봉01 선덕학원 하차 G 111911281157  세그루학원 하차 G 도봉05  우성1차아파트 초당초등학교 하차  승용차 시청 → 세종로사거리 우측 → 종로5가 이화사거리 → 혜화동사거리 → 미아사거리 → 강북구청 → 광산사거리 → 숭미초등학교 → 쌍문근린공원  주차장 주차장이 없으므로 대중교통을 이용하시기 바랍니다. ','도봉구','서울특별시 도봉구 쌍문동 산80','02-2091-3754'),(84,'수락산도시자연공원','수락산의 명칭은 내원암 일대 계곡에 바위가 벽을 이루고 있어 물이 굴러떨어지므로 수락이라 하였다는 설과 골짜기 물이 맑아 금류 은류 옥류라는 폭포를 이루어 떨어지는 자태에서 이름이 붙여졌다는 전설도 있으며 명당 기슭에는 선조의 생부인 덕흥대원군의 묘역과 흥국사 내원암 덕릉고개가 있으며 왕실의 지원으로 사찰들이 번창한 곳이다. 수락계곡지구 노원골 지구 동막골 지구로 세부 되어 있으며 수락계곡지구는 벽운 유원지와 연계하여 조성하고 기존의 약수터 야영장을 정비하여 인근 주민들의 휴식공간으로