 확인되지 않는다‘. 과천읍지’(1899) 산천조에는 청룡산이라고 쓰고 있는데 이는 관악산을 백호산이라고 부른데 대하여 청계산이 좌청룡에 해당된다는 풍수설에 따라 청룡산이라 부른것으로 짐작된다. 청계산 북동쪽 기슭은 선사시대 주민들의 생활근거지로 청동기시대의 유적인 고인돌이 산재해 있으며 고려 멸망 후 이색 길재 조윤 등 고려 유신들이 은거했던 곳이다. 청계산의 주봉을 망경대라 부르는데 이는 고려가 망한 뒤 고려 유신 조윤이 청계산 정상에서 송도를 바라보며 세월의 허망함을 달랬다는데서 유래하고 조선 말기에는 추사 김정희가 긴 유배생활에서 돌아와 부친의 여막을 지키면서 살았던 곳이다. 청계산은 서울특별시와 경기도 성남시?과천시?의왕시의 경계에 위치해 있으며 과천에서 동남쪽으로 5km 안양에서 동쪽으로 12km 서울에서 18km의 거리를 두고 있다. 전체 면적은 약 3.7㎢로 매봉을 중심으로 서쪽은 경기도 동쪽은 서울특별시로 구분된다. 산세는 서남쪽으로 의왕시에 소재한 백운산?모락산?오봉산으로 뻗쳐 있고 서북쪽으로 과천시 옥녀봉 자락과 이어져 대체로 남북 방향으로 자리하고있다. 청계산은 국사봉(540m) 망경대(600m) 매봉(583m) 및 옥녀봉(375m)을 이어 남북으로 달리는 능선과 국사봉을 정점으로 하여 동서방향으로 달리는 능선이 만나 T자형 능선을 이루고 있고 계곡은 이와 같은 T자형 능선을 기점으로 하여 동서방향과 남쪽방향으로 발달해 있다.','','서초구','서울특별시 서초구 원지동 산 33','02-2155-6870'),(113,'개화근린공원','개화산의 원래 이름은 주룡산(駐龍山)으로 신라시대 주룡이라는 한 도인이 산에 살면서 매년 9월 9일에 동자 두세 명과 더불어 높은 곳에 올라가 술을 마시며 구일용산음(九日龍山飮)이라하여 주룡산이라 불리었다. 도인이 돌아간 후에 그 자리에는 이상한 꽃 한 송이가 피어나 이를 두고 사람들은 ‘개화산(開花山)’ 이라 불렀다 한다.  개화공원은 한강이 내려다보이는 숲이 울창한 공원으로 약사사와 미타사 2개의 사찰이 있고 특히 약사사의 석불과 3층 석탑은 서울시 유형문화재로 지정된 귀중한 문화재이며 미타사 옆에는 한국전쟁시 장렬히 산화한 호국 영령을 추모하는 호국충혼 위령비가 있고 약수터 3개소와 한강을 굽어보는 울창한 산림이 잘 보존된 곳이다.','제1등산로 : 지하철5호선 방화역(3번출구) 방화근린공원 제2등산로 : 지하철5호선 방화역(3번출구) 방화5단지 교차로 방원중학교 제3등산로 : 지하철5호선 방화역(3번출구) 방원중학교 무장애숲길 입구 ','강서구','서울특별시 강서구 개화동 산17','02-2600-4183'),(114,'아차산생태공원','서울특별시에서 공원녹지 확충 5개년 계획에 따라 조성된 아차산 생태공원은 시민과 학생들에게 자연을 접할 수 있는 기회와 자연생태계 학습장 및 체험공간을 제공하고 있습니다. 또한 도시생태계의 생물 다양성을 증진시키고 시민들에게 건강하고 건전한 녹지공간의 쉼터를 제공함으로써 도시환경의 질적 향상에 기여하고 있습니다.','제1등산로(광개토대왕길) : 아차산역(지하철5호선) ~ 3번 마을버스 ~ 도보 제2등산로(긴고랑길) : 군자역(지하철5호선) ~ 마을버스 2번    ','광진구','서울특별시 광진구 광장동 370','02-450-1192'),(115,'인능산도시자연공원','','버스 : 양재역 중앙버스정류장에서 440 462 407 408 140번 버스 탑승 후 서울특별시립 어린이병원 정류장에서 하차 5분 도보1 버스 : 양재역 10번 출구 버스정류장에서 4432번 버스 탑승 후 새쟁이바을 정류장에서 하차 20분 도보    ','서초구','서울특별시 서초구 내곡동 산12-404','02-2155-6873'),(116,'구룡산','구룡산은 대모산과 하나의 줄기를 가진 산으로 서초구와 강남구 경계에 걸쳐 있으며 두 산은 1971년 대모산 도시자연공원으로 지정되어 관리되어 오고 있다. 높이 306m의 산으로 높거나 험하지 않아 부담없이 하는 산행코스로는 제격입니다.','접근방법 제1등산로 : (정류장 번호 : 22-302 버스 : 140 407 408 440 등) 하차 후 코이카 뒤쪽 등산로 제2등산로 : (정류장 번호 : 22-367 버스 141 405 등)하차 후 염곡약수터 등산로(10분 도보) 제3등산로 : 내곡동주민센터 정류장 하차 후 20분 도보 후 염곡마을 등산로 ','서초구','서울특별시 서초구 염곡동 산25-1','02-2155-6869'),(117,'우면산도시자연공원','서초구 서초동?방배동?우면동?양재동의 경계를 이루는 산으로 산모양이 소가 졸고 있는 모양이라 하여 붙여진 이름이다. 일부 지역에 대하여는 갓바위가 있는 산이라 하여‘관암산(冠岩山)’ 산이 도마와 같이 생겨서‘도마산’ 옛날에 활을 쏘던 사정이 있던 곳으로‘사정산(射亭山)’수정이 채굴되었다 하여‘수정봉(水晶峰)’등이 있다. 산높이는 293m로 서울 서초구와 과천시의 경계에 위치하며 산행코스가 짧고 힘든 코스가 많지 않아 주말 및 새벽 산행 코스로 적합하며 여러 계곡에서는 맑은 옹달샘이 끊임없이 흘러나오고 있으며 울창한 삼림으로 다양한 동?식물군이 서식하고 있다. 산책로 및 등산로가 태극 범바위 산골약수터 등 20여개소의 약수터와 대성사 예술의 전당 등 문화유적과 사찰 문화공간이 연접되어 있어 아늑한 휴식처를 제공하고 있다.','주요 등산로 출입구는 남부순환로에 위치하고 있으므로 지하철 3호선 남부터미널역 또는 버스정류장 예술의전당 앞에서 하차 서초약수터~소망탑 코스 : 남부터미널역(도보 5분) 버스 임광A~소망탑 코스 : 버스 전원마을~성산약수터 코스 : 남태령역(도보 10분) 버스 ','서초구','서울특별시 서초구 우면동 산35-1','02-2155-6883'),(118,'향림근린공원','갈현근린공원은 연서로를 사이에 두고 은평경찰서에서 통일로의 박석고개까지 연결된 제1구역과 은평경찰서 맞은편에서 불광중학교 뒷산을 거쳐 북한산국립공원 매표소까지 연결된 제2구역으로 나뉜다. 제1구역은 북쪽산자락에 구립체육센터와 축구장이 자리잡고 남쪽 자락에는 세명컴퓨터 고등학교와 연천중학교가 있다. 불광 2?3동과 진관동을 아우르는 갈현근린공원은 면적이 147859㎡이며 높이는 해발 123m이다. 은평구를 대표하는 체육공원인 갈현근린공원의 주요시설은 구민체육센터와 축구장 테니스장 외에 기타 운동?3편익시설 70점이 설치되어 있다. 나무는 93종(큰키나무 36종 중간키나무 10종 작은키나무 34종 덩굴나무 13종)이 자라고 있으며 약재로 많이 쓰여 서양에서 약상자라는 별명을 갖고 있는 미국딱총나무가 특히 제1구역에 많이 퍼져있다. ','','은평구','서울특별시 은평구 진관동 산55','02-351-8002'),(119,'신사근린공원','남으로는 봉산공원 매봉산 월드컵공원이 위치하고 동으로는 진관?갈현공원 북한산과 연결된 서울의 서북단의 외곽녹지를 형성하고 있는 공원이다. 주능선이 남북으로 길게 발달해 있고 가장 높은 봉우리가 270m로 비교적 높지 않은 경사가 완만한 산이며 주택가 생활권 주변으로 등산로가 발달되어 많은 주민들이 즐겨 이용하고 있는 산중의 하나다. 이곳에는 조선왕조의 왕후의 묘(창능 명능 익능 홍능 경능)가 위치한 서오능이 연접해 있고 상수리?굴참?신갈나무 등 참나무류와 소나무림이 군집해 있다. 특히 서울도심에서 보기 어려운 극상 수종인 서어나무 군집지가 분포하고 있는 등 양호한 생태환경이 보전되어 있는 산으로 현재 은평구에서 역사와 문화 자연생태를 배우고 체험하는 앵봉산 숲속여행지로 이용하고 있다. 서식 식물은 총 77여종이며 조류의 경우 총 6목 18과 29종(텃새20종) 겨울철새 3종 여름철새 6종 등이 서식하고 있다. 보호가 요구되는 법적 보호종은 천연기념물 제323호인 황조롱이와 맹금류인 말똥가리가 가끔 관찰된다. 양서류 파충류로는 도룡뇽 청개구리 북방산개구리 3종이 발견되며 곤충류로는 주로 나비목 및 파리목의 곤충이 관찰된다.','','은평구','서울특별시 은평구 신사동 산80-4','02-351-8004'),(120,'문화역 서울284','누구에게나 열려있는 역동적이고 개방된 복합문화공간입니다. 대한민국 근현대사의 주요무대이자 교통과 교류의 관문이었던 구 서울역을 원형 복원한 후 다양한 문화예술이 창작되고 교류가 이루어 지는 곳으로 공식 출범을 하였습니다.','','중구','서울특별시 중구 통일로 1 서울역','02-3407-3500'),(121,'광평근린공원','서울시 유형문화재 제48호인 광평대군 묘역을 중심으로 지정된 공원으로 대모산 동북쪽에 위치하고 있으며 광평대군 묘역은 광평대군 묘소를 비롯한 태조의 아들 무안 대군 방 번의 묘소 등 그 종문의 700 여기의 묘소가 있으며 전주이씨 광평대군파종회에서 관리하고 있다. ','','강남구','서울특별시 강남구 수서동 산10-1','02-3423-6243'),(122,'청담근린공원','청담공원은 고층 아파트와 단독주택지 상가가 밀집된 청담동에 위치한 산지형 공원으로 도심의 중요한 자연공간이다. 공원에 들어서면 마치 숲 속에 들어온 듯한 착각을 일으킬 정도로 실개천의 물소리와 산새들의 새소리가 들리며 산을 올라가면 다양한 운동을 할 수 있는 운동공간과 시를 읽으며 산책할 수 있는 시비 광장이 조성되어 있다. 또한 공원 내 위치한 청소년회관은 청소년과 공원 이용객들에게 수준 높은 문화 프로그램을 제공한다. ','','강남구','서울특별시 강남구 청담동 66','02-3423-6244'),(123,'허브천문공원','일자산은 서울시 강동구와 경기도 하남시를 경계로 하고 있는 자연이 잘 보존되어 있는 야산으로 길동생태공원 맞은편에 허브천문공원이 위치한다. 이곳은 안정적인 수돗물 공급을 위한 배수지가 있는 곳으로 웰빙시대를 맞이하여 주민들에게 쾌적한 공간을 제공하고자 상수도사업본부와 강동구가 협력하여 하늘과 땅을 잇는 천문과 햇빛이 풍부하고 바람이 잘 통하는 곳에서 잘 자라는 허브를 테마로 배수지 상단부에 조성한 공원이다. 허브원 약초원 암석원 등으로 구성된 허브천문공원은 한민족 고유의 전통사상인 삼재(天?地?人) 사상에서 공간개념을 도출하여 우주공간(자미원 태미원 천시원 별자리 은하수 등)을 공원에 투영하고 음양 보행 사상에 기초하여 시설물 및 수목 등을 배치한 것이 그 특징이다. ','','강동구','서울특별시 강동구 둔촌동 산94','02-3425-6454'),(124,'연신내물빛공원','지하철 36호선 연신내역에서 엘리베이터를 통해 쉽게 접근할 수 있도록 위치한 연신내 물빛공원은 도심속에서 자연을 느끼고 휴식을 취하며 재충전할 수 있는 휴식과 만남의 공간이자 많은 공연과 행사가 이루어지는 문화공간이다. 지하철역에서 나오는 깨끗한 지하수를 공원의 친수공간으로 효율적으로 활용하고 불광천에 흘려보내 맑고 깨끗한 하천을 가꾸는데 크게 이바지하고 지역의 역사성과 상징성 편리성 효용성 등이 반영된 공원으로 동즉으로는 우리민족의 통일에 대한 염원과 희망을 상징하는 일출분수가 설치되어 있고 공원 중심부에 연신내를 상징하는 태극모양의 수반과 회자(回字)모양의 곡수로가 설치되어 있으며 서측에는 조선시대 한양의 통신수단의 거점이었던 파발의 모습들을 형상화하여 우리고장의 역사성을 나타내는 파발가벽이 조성되어 있다. 그 밖에 지하철 동출시설과 주변 경관과 어울릴 수 있는 소나무 단풍나무 화살나무 영산홍등이 계절에 따른 자연의 변화를 느낄 수 있게 한다. 주변의 시민과 어린이들이 직접물과 접하면서 즐길 수 있는 공간인 연신내 물빛공원에서는 매년 4월~10월 첫째 목요일에 물빛공원 음악회가 열리는 등 크고 작은 문화공연들이 열려 가까운 곳에서 자연과 문화를 함께 느낄 수 있는 공간으로 많은 시민들의 사랑을 받고 있다. ','','은평구','서울특별시 은평구 통일로 849','02-351-8012'),(125,'나들이근린공원','야생초화원 및 맨발광장 야생초화원에는 감국금낭화 도라지 등 19종 49500본이 식재되어 있다. 그 옆 맨발광장에는 120m의 지압보도가 설치되어 있는데 다양한 지압돌로 시민들에게 인기가 있는 곳이다. 관리사무소옆에 설치되어 있는 배드민턴장은 4면으로 이루어져 있고 그 위쪽에 설치된 피크닉장에는 가족들이 모여 이용할 수 있는 야외탁자가 16개소 설치되어 있다. 뜀동산 서울에서 최초로 야외에 조성한 뜀동산은 계절에 따라 하절기(7~8월)는 오전 10~12시 오후2시~5시30분 춘추기(3~6월 9~11월)는 오전 10시~오후5시30분까지 운영하고 있다. 비나 눈이 올 경우에는 운영하지 않는다. 농촌체험장 농촌체험장 한가운데 외양간에는 소모형 3마리와 옛날 농기구 18종이 전시되어 있고 장독대 텃밭과 배나무가 80여그루가 식재된 과수원 등 정겨운 농촌풍경이 펼쳐진다. ','','중랑구','서울특별시 중구 망우동 산 30-7 일대','02-435-7168'),(126,'숭인근린공원','서울특별시 종로구 숭인동 동망산(東望山)에 있는 공원이다. 동망산공원이라고도 한다. 면적 45615㎡로서 주민들이 휴식과 산책 가벼운 운동을 할 수 있는 자연친화적 공간이다. 공원 안에는 정자와 체력단련시설 관리사무소 화장실 등이 있다. 공원이 있는 동망산의 봉우리를 동망봉이라 부르는데 단종이 영월로 귀양을 가자 단종비 송씨(정순왕후)가 초가암자 정업원(淨業院)을 짓고 동쪽 영월을 바라보며 단종을 그리워한 곳이라 하여 붙여진 이름이다. 2008년 4월 이 공원에서 정순왕후를 기리는 추모제가 열렸다.','','종로구','서울특별시 종로구 숭인동 58','02-2148-4152'),(127,'서일대뒷산공원','망우동과 면목동 경기도 구리시에 걸쳐있는 망우산은 해발 281.7m이며 망우산 일대에는 묘지가 있다. 1933년 5월 27일 경기도의 임야 일부를 경성부에서 양도받아 묘지로 사용하게 되면서부터 묘지가 들어서게 되었다. 현재 서울시 안에 있는 유일한 공동묘지로 총면적 190884평에 약 15532기의 분묘가 있으며 1973년 3월 25일 봉분이 가득 차서 매장을 금지하고 있다. 우리나라 어린이운동의 효시인 방정환 독립운동가이며 민족대표 33인의 한분인 오세창 한용운 우두보급의 선구자로 의학자이며 국어학자인 지석영 임시정부 내무부서기를 역임한 독립운동가 문명훤 동일일보 주필과 한국민주당 창당을 주도했던 장덕수 제헌국회의원이며 진보당 당수였던 조봉암 등의 묘소가 있다. 망우동 산 57-1번지일대 망우리 공원 내의 5.2㎞의‘사색의 길’이라는 산책로가 있어 많은 시민들이 찾고 있다.','','중랑구','서울특별시 중랑구 면목동 산19','02-2094-2363'),(128,'용마도시자연공원(사가정공원)','2005년 4월 13일 개장한 사가정공원은 면목동 산 50번지 일대의 면목약수터지구 입구에 약 3만3천2백여면 규모로 조성되었다. 공원의 명칭은 용마산 부근에서 거주했던 조선 전기의 문인인 서거정 선생의 정취를 느낄 수 있도록 그의 호를 따서 지어졌다. 또한 그의 대표적인 시 4편을 골라 시비를 만들어 설치함으로써 공원이용객들이 산책과 함께 명시를 감상할 수 있는 기회를 제공하고 있다. 이곳에서 피크닉장 어린이놀이터 체력단련시설 자연형계류 사가정(전통정자) 다목적광장 냇가휴게소 등 다양한 휴게 시설과 운동시설 조경시설이 갖춰져 있어 주민들의 수준 높고 쾌적한 휴식공간이자 중랑구의 명소로 자리잡고 있다. 한편 사가정공원 오른편에는 수영장과 체력단련장 대체육관 등을 갖춘 지하2층 지상3층 연면적 6109㎡(1848평)규모의‘중랑문화체육관’이 2006년 9월25일 개관하였다. ','','중랑구','서울특별시 중랑구 면목7동 산50 ','02-2094-2993'),(129,'문화비축기지','매봉산자락에 위치한 문화비축기지는 폐산업시설인 \'마포석유비축기지\'를 재생하여 역사적 의미를 보존하며 지속가능한 생태 문화적시민 활동을 위한 문화공원입니다. 2013년 시민의 참여를 통해석유비축탱크 활용 아이디어를 공모하고 2014년국제현상설계공모 당선작 \'땅으로부터 읽어낸 시간\' 을바탕으로 산업유산 재생과 석유비축탱크의 공간적 특성을 살려 친환경 복합 문화공간으로 조성되었습니다.  기존의 5개의탱크는 공연장 전시장 다목적파빌리온으로재생하고 새롭게 신축하는 1개의탱크는 커뮤니티센터 임시주차장이었던 넓은 야외공간은 문화마당으로 재탄생하여 시민들의 휴식과 다양한 커뮤니티 활동이 가능한 공간으로 조성되었습니다. ','','마포구','서울특별시 마포구 증산로 87','02-376-8410'),(130,'경춘선숲길','일제 강점기때 우리 민족의 자본으로 만든 최초의 철도시설로 1939년 7월 25일 개통 2010년 12월 20일을 끝으로 71년간의 마지막 열차운행을 마치고 폐선이 되었습니다.  버려졌던 폐철길을 2013년부터 단계적으로 공원으로 조성하여 경춘선의 추억을 되살리고 다시금 생명이 깃든 길을 만들어 천천히 쉬어가며 자연과 나란히 걸을 수 있게 재탄생 시켜 나가고 있습니다.  ','지하철 이용시 지하철 7호선 하계역 4번출구 미성/장미아파트 도로 450m직진 지하철 6호선 화랑대역 2번 4번 출구 버스 이용시 간선 105 146 (서울과학기술대입구 정류장 하차) ','','노원구 공릉2동 산 82-2','02-2289-4012'),(131,'율현공원','? 율현공원은 보금자리주택 세곡2지구 사업의 결과물로 만들어졌다. 공원은 주택지구의 동남쪽 영역에 넓게 분포되어 있으며 아파트 진입 도로에 의해 아파트 쪽의 근린공원 3호 탄천변의 근린공원 4호로 나뉘어져 있다. 공원은 너른 잔디광장과 랜드마크 역할을 하는 공원관리동 그리고 각종 편의시설이 있어 시민들이 여유롭게 휴식을 취할 수 있으며 탄천 변에 저류조가 있어 다양한 수생식물과 각종 철새들의 보금자리가 되고 있다.','','강남구','서울특별시 강남구 율현동 밤고개로24길(율현동 56)','02-459-9452');
